import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link, useLocation } from 'react-router-dom';
import Home from './Home';
import AboutUs from './AboutUs';
import ContactUs from './ContactUs';
import ItemDetails from './ItemDetails';
import Login from './Login';
import Signup from './Signup';
import ShowCart from './ShowCart';
import MyOrder from './MyOrder';
import HeroSection from './HeroSection';
import { useAuth } from './AuthContext';
import Checkout from './Checkout';
import ForgetPassword from './ForgetPassword';
import Footer from './Footer';
import './App.css'; // Include CSS for styles

const App = () => {
  const { isAuthenticated, logout } = useAuth();
  const location = useLocation(); // Get the current path

  const showFooter = location.pathname !== '/cart'; // Hide footer on the cart page

  return (
    <Router>
      <div className="container">
        <header className="d-flex justify-content-between align-items-center py-3 border-bottom">
          <Link to="/" style={{ textDecoration: 'none', color: 'inherit' }}>
            <h1>Dessert-a-licious<span style={{ color: 'red' }}>.</span></h1>
          </Link>

          <div>
            <Link to="/about-us" style={{ textDecoration: 'none', color: 'inherit' }} className="px-2">About Us</Link>
            <Link to="/contact-us" style={{ textDecoration: 'none', color: 'inherit' }} className="px-2">Contact Us</Link>
            {isAuthenticated ? (
              <button onClick={logout} className='btn btn-link'>Logout</button>
            ) : (
              <Link to="/login" style={{ textDecoration: 'none', color: 'inherit' }} className="px-2">Login</Link>
            )}
            <Link to="/cart" className="px-2">
              <img src='/images/cart.png' alt='Cart' style={{ height: '32px' }} />
            </Link>
          </div>
        </header>

        <Routes>
          <Route
            path="/"
            element={
              <>
                <HeroSection />
                <Home />
              </>
            }
          />
          <Route path="/about-us" element={<AboutUs />} />
          <Route path="/contact-us" element={<ContactUs />} />
          <Route path="/items/:id" element={<ItemDetails />} />
          <Route path="/login" element={<Login />} />
          <Route path="/signup" element={<Signup />} />
          <Route path="/cart" element={<ShowCart />} />
          <Route path="/my-order" element={<MyOrder />} />
          <Route path="/checkout" element={<Checkout />} />
          <Route path="/forgetpassword" element={<ForgetPassword />} />
        </Routes>

        {/* Conditionally render the footer based on the route */}
        {showFooter && <Footer />}
      </div>
    </Router>
  );
};

export default App;
